import { TextField } from "@mui/material";
import React from "react";
import SearchIcon from "@mui/icons-material/Search";
const SearchBar = () => {
  return (
    <div>
      <TextField
        id="outlined-basic"
        label="Search"
        variant="outlined"
        style={{ width: "450px" }}
      />

    </div>
  );
};

export default SearchBar;
